INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (28, '-dim', 'to', 'a morpheme that means to; as in I walked to the house.: Case Marker: Suffix for goal (see also ''-di'') used in cases when ''-di'' (goal) ending is hard to distinguish from the ''-de'' (source) ending', 'affix', '', '', '');
