INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (31, '-ha', 'at', 'morpheme used to indicate where something or someone is located; Bíi ril Athid botheha wa. (Athid is at the hotel.); Case Marker: suffix for place (see also ''-sha'')', 'affix', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (32, '-ha', 'at', 'location in space', 'location marker', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (33, '-háa', 'embed relative clause', 'Embedding Marker: to embed a relative clause (like English I know the womah who is tired) attached to the last element in the embedded clause (see also ''-hé''; ''-hée'')', 'affix', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (34, '-háalish', 'to an extraordinary degree', 'Degree Marker: to an extraordinary degree (see also ''-hil''; ''-hal''; ''-hul''; ''-hel'')', 'affix', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (35, '-háalish', 'to an extraordinary degree', '', 'degree marker', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (36, '-hal', 'to an unusual degree', 'Degree Marker: to an unusual degree; very (see also ''-hil''; ''-hel''; ''-hul''; ''-háalish'')', 'affix', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (37, '-hal', 'to an unusual degree', 'very', 'degree marker', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (38, '-hé', 'embed statement', 'morpheme used to embed one statement inside another statement; Embedding Marker: to embed a sentential complement (like English I know that she left) attached to the last element in the embedded clause (see also ''-háa''; ''-hée'') When we want to put one English statement inside another one -- a process called ''embedding'' -- we can use the word ''that'' to mark the statement that is embedded. For example: ''I know that science fiction conventions are fun'' embeds the statement ''science fiction conventions are ''fun'' inside ''I know [some other statement]'' by putting ''that'' at the beginning of the embedded statement. LAadan embeds one statement in another by putting the morpheme ''-hE'' on the last word of the embedded statement. So in sentence #7 the statement ''radezhehul thod Aabeth'' -- ''writing a book is very hard'' is marked as an embedded statement by adding ''-hE'' to ''Aabeth.'' [Note: An embedding morpheme is the _only_ morpheme that can follow a case-marking morpheme.]', 'affix', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (39, '-hée', 'embed question', 'Embedding Marker: to embed a question (like English I wonder whether/if she left) attached to the last element in the embedded clause (see also ''-hé''; ''-háa'')', 'affix', '', '', '');
INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (40, '-hel', 'to a trivial degree', 'Degree Marker: to a trivial degree; slightly (see also ''-hil''; ''-hal''; ''-hul''; ''-háalish'')', 'affix', '', '', '');
