INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (688, 'doroledim', '(sublimation with food accompanied by guilt about that sublimation) This word has no English equivalent whatsoever. Say you have an average woman. She has no control over her life. She has little or nothing in the way of a resource for being good to herself; even when it is necessary. She has family and animals and friends and associates that depend on her for sustenance of all kinds. She rarely has adequate sleep or rest; she has no time for herself; no space of her own; little or no money to buy things for herself; no opportunity to consider her own emotional needs. She is at the beck and call of others; because she has these responsibilities and obligations and does not choose to (or cannot) abandon them. For such a woman; the one and only thing she is likely to have a little control over for indulging her own self is FOOD. When such a woman overeats; the verb for that is doroledim. (And then she feels guilty; because there are women whose children are starving and who do not have even THAT option for self-indulgence... )', '', '', '', '', '');
