INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (1261, 'lh- or -lh or -lh-', 'bad', 'bad (intentionally) <infix> The pejorative element lh can always be added to a word to give it a negative connotation; so long as it precedes or follows a vowel and does not violate the rules of the Laadan sound system by creating a forbidden cluster. The addition of lh need not create an actual new word; for example; awith  means baby-to use instead lhawith (or awithelh) means only something like the darned baby and is ordinarily a temporary addition. But it is very handy indeed. We are indebted to the Navajo language for this device.', 'affix', '', '', '');
