INSERT INTO dictionary(id, laadan, english, description, classification, breakdown, notes, unofficial) VALUES (2440, 'wo-', '', 'changes a verb to an adjective; must be put on both verb and noun; after plural marker (beautiful woman = woháya wowith) Láadan has a form that is much like an English adjective + noun sequence; as in green tree or small child. You can take any sequence of verb and subject (remembering that adjectives are only ordinary verbs in Láadan) and but the marker wo- at the beginning of each one. Beautiful woman is thus woháya wowith. This is very useful; but it is a bit different from English; because it can only be used if you have just one verb. You cannot use this pattern to translate an English sequence like little red brick wall. To make your descriptive phrase plural; you would put the plural marker me- at the beginning of the verb; as always. Busy dragons would be mewoshOod wohOowamid.', 'affix', '', '', '');
